PREFIX fhir: <http://hl7.org/fhir/>
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX se: <http://example.org/myontology#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?conditionId ?icd9_display ?icd10_display ?category_code ?icd10_code ?icd9_code
WHERE {
  ?condition a fhir:Condition .
  ?condition fhir:patient_reference ?patient .
  ?patient fhir:id "ece255e8-656b-5e09-8da9-33f88bc270a1" .

  # Optional Condition fields
    OPTIONAL { ?condition fhir:id ?conditionId. }
    OPTIONAL { ?condition fhir:identifier ?conditionIdentifier. }
    OPTIONAL { ?condition fhir:icd9_code ?icd9_code. }
    OPTIONAL { ?condition fhir:icd9_display ?icd9_display. }
    OPTIONAL { ?condition fhir:icd10_code ?icd10_code. }
    OPTIONAL { ?condition fhir:icd10_display ?icd10_display. }
    OPTIONAL { ?condition fhir:category_code ?category_code. }
}

PREFIX fhir: <http://hl7.org/fhir/>
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX se: <http://example.org/myontology#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT (AVG(?age) AS ?averageAge)
WHERE {
  ?patient a fhir:Patient .
  OPTIONAL { ?patient fhir:age ?age. }
}

PREFIX fhir: <http://hl7.org/fhir/>
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX se: <http://example.org/myontology#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT ?name (COUNT(DISTINCT ?patient) AS ?patientCount)
WHERE {
  ?locationEncounter a fhir:LocationEncounter .
  ?locationEncounter fhir:patient_reference ?patient .
  ?locationEncounter fhir:location_reference ?location .
  ?location a fhir:Location .

  # Optional Location fields
  OPTIONAL { ?location fhir:name ?name. }
  OPTIONAL { ?location fhir:organization_reference ?organization_reference. }
  OPTIONAL { ?location fhir:id ?locationId. }
  OPTIONAL { ?location fhir:location_physical_type_display ?type_display. }
  OPTIONAL { ?location fhir:location_physical_type_code ?type_code. }
  OPTIONAL { ?location fhir:status ?status. }

}

GROUP BY ?name

PREFIX fhir: <http://hl7.org/fhir/>
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX se: <http://example.org/myontology#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?specimenId ?collected_datetime ?spec_type_desc_display
WHERE {
  ?specimen a fhir:Specimen .
  ?specimen fhir:patient_reference ?patient .

  ?patient a fhir:Patient .
  ?patient fhir:id "d378a59b-aa80-5bc5-812a-7d59b26e7df4" .

  # Optional Specimen Fields
  OPTIONAL { ?specimen fhir:lab_fluid_code ?lab_fluid_code. }
  OPTIONAL { ?specimen fhir:spec_type_desc_code ?spec_type_desc_code. }
  OPTIONAL { ?specimen fhir:spec_type_desc_display ?spec_type_desc_display. }
  OPTIONAL { ?specimen fhir:collected_datetime ?collected_datetime. }
  OPTIONAL { ?specimen fhir:id ?specimenId. }
  OPTIONAL { ?specimen fhir:identifier ?identifier. }
}

PREFIX fhir: <http://hl7.org/fhir/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX se: <http://example.org/myontology#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?conditionId ?icd9_display ?icd10_display ?category_code ?icd10_code ?icd9_code
WHERE {
  ?condition a fhir:Condition .
  ?condition fhir:patient_reference ?patient .
  ?patient a fhir:Patient .
  ?patient fhir:identifier "10000032" .

  # Optional fields for Condition
  OPTIONAL { ?condition fhir:encounter_reference ?encounter. }
  OPTIONAL { ?condition fhir:id ?conditionId. }
  OPTIONAL { ?condition fhir:identifier ?conditionIdentifier. }
  OPTIONAL { ?condition fhir:icd9_code ?icd9_code. }
  OPTIONAL { ?condition fhir:icd9_display ?icd9_display. }
  OPTIONAL { ?condition fhir:icd10_code ?icd10_code. }
  OPTIONAL { ?condition fhir:icd10_display ?icd10_display. }
  OPTIONAL { ?condition fhir:category_code ?category_code. }
}
